<template>
    <section class="hero is-fullheight background">
        <div class="hero-body">
            <div class="container has-text-centered">
                <div class="column is-offset-5 input-container">

                    <div class="is-half">

                        <div class="field login-form-item">
                            <h3 class="y-logo">
                            </h3>
                            <div class="control">
                                <input
                                        class="input"
                                        type="txt"
                                        v-model.trim="$v.username.$model"
                                        placeholder="请输入帐号"
                                        autofocus
                                >
                            </div>
                        </div>
                        <!-- <pre>{{ $v }}</pre> -->
                        <div class="field login-form-item">
                            <div class="control">
                                <input
                                        class="input"
                                        type="password"
                                        v-model="$v.password.$model"
                                        placeholder="请输入密码"
                                >
                            </div>
                        </div>

                        <!-- <div class="field">
                               <div class="control">
                                 <input class="input" type="txt" v-model="captcha" placeholder="请输入验证码">
                                </div>
                        </div>-->
                        <button class="button is-block is-info is-large is-fullwidth login-form-item" @click="doLogin">登录</button>
                    </div>

                    <p class="has-text-grey tech-item">技术支持   <a href="http://www.taiheiot.com/" target="_blank">深圳市太和物联信息技术有限公司</a></p>
                </div>
            </div>
        </div>
    </section>
</template>

<script>
    define(["Vue", "api", "validators", "common", "MD5"], function (Vue, api, vali, com, MD5) {
        "use strict";
        //简易版校验
        const required = vali.required;
        const minLength = vali.minLength;

        var that;
        // --
        var result = {
            template: template,
            data: function () {
                var time = new Date();
                return {
                    loaded: time,
                    username: "",
                    password: "",
                    captcha: ""
                };
            },
            validations: {
                username: {
                    required
                },
                password: {
                    required
                }
            },
            mounted() {
                // console.log('mounted');
                that = this;
                window.onkeyup = (e) => {
                    if (e.key === 'Enter') {
                        this.doLogin()
                    }
                }
            },
            methods: {
                /**
                 * 有input 的时候,注意验证用户输入的东西
                 */
                vali() {
                    return this.$v.$invalid;
                },

                /**
                 * 登录
                 */
                doLogin() {

                    // 验证数据
                    if (this.vali()) {
                        this.$message.error("账号密码不能为空");
                        return false;
                    }

                    let obj = {
                        userName: this.username,
                        passWord: MD5(this.password)
                    };
                    // this.$v.$touch();
                    // console.log(this);

                    api.doLogin(obj).then(function (res) {
                        if (res.code == 200) {
                            // 登录数据存储
                            com.storeValue("authInfo", JSON.stringify(res.data), "session");

                            console.log('登录成功');
                            // 登录成功 redirect
                            // that.$router.push({ path: that.$route.query.redirect });
                            // that.$router.push({ path:"/" })
                            // 增加了权限控制跳转有问题

                            window.location.reload();


                        } else {
                            that.$message.error(res.msg);
                        }
                        // console.log(res);
                    });
                    // console.log('dologin');
                }
            }
        };

        // vue-login
        Vue.component("vue-login", result);

        return result;
    });
</script>


<style>
    /* 这里只写这个模块所用的 css */
    .input-container{
        width: 420px;
    }
    .background{
        background-image: url('data:image/png;base64,');
    }
    .y-logo{
        width: 420px;
        height: 160px;
        background-image: url('data:image/png;base64,');
        -webkit-background-size: cover;
        background-size: cover;
        margin-bottom: 40px;
        transform: translateX(-10px);
    }
    .login-form-item{
        margin-top: 30px;
    }
    .tech-item{
        margin-top: 100px;
    }

</style>
